import React, { useState, UseState } from "react";
import { FaLocationArrow } from "react-icons/fa";
import { Link } from "react-router-dom";
import "./App.css";

function Nav() {
  const [onHover, useOnHover] = useState(false);

  const navStyle = {
    textDecoration: "none",
    color: "inherit",
  };

  return (
    <nav>
      <ul>
        <Link
          className="home"
          to="/"
          style={navStyle}
          onMouseEnter={useOnHover(true)}
          onMouseLeave={useOnHover(false)}
        >
          <li>Home</li>
        </Link>
        <button>
          <FaLocationArrow className="location-btn" />
        </button>
        <Link to="/login" style={navStyle}>
          <li>Login</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
